import React from 'react';
import { View, Text, Image } from 'react-native'

import styles from "./styles";

export default function ProfilPicture() {
    return(
        <Image style={styles.image} source={{ uri : 'https://upload.wikimedia.org/wikipedia/commons/thumb/f/fa/Wiki_training_0226.jpg/207px-Wiki_training_0226.jpg'}}/>
    )
}
